return (

    <header>
        <h1>Keeper</h1>
        <div className="header-class">
        <ul>
            <li>
                <NavLink to="/">Home</NavLink>
            </li>
            <li>
                <Link to="/blogs">Blogs</Link>
            </li>
            <li>
                <Link to="/contact">Contact</Link>
            </li>
      </ul>
        </div>
    </header>
)};



export default Header;
